package com.company.library_project.entity;import com.company.library_project.entity.base.StringBaseEntity;import com.company.library_project.entity.profile.ProfileEntity;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;import java.util.List;@Setter@Getter@Entity@Table(name = "category")public class CategoryEntity extends StringBaseEntity {    @Column(name = "name", nullable = false, unique = true, length = 50)    private String name;    @OneToMany(mappedBy = "categoryEntity", fetch = FetchType.EAGER)    List<BookEntity> bookEntityList;    @ManyToOne    @JoinColumn(name = "owner_id", insertable = false, updatable = false)    private ProfileEntity profileEntity;    @Column(name = "owner_id")    private String ownerId;}